import { Button } from 'primereact/button';
import { Calendar } from 'primereact/calendar';
import { BrowserRouter, Route, Router, Routes, useParams } from 'react-router-dom';

import react, { useEffect, useState } from "react";

import { ReactDOM } from 'react';
import "./index.css";
//import {ZodiacSignsDetail} from './data'; 
//import Card from './card';
//import Context from './Context';
//import zodiacDetail from './zodiac'; 
//import Zodiac from './zodiac';
//import Test from './test';
import NavBar from './Navbar';

import Aries from './aries';

function App(){
   
    
 

    return(
        <BrowserRouter ><div className='header' ><h1>Zodiac Calendar</h1></div>
         <div className='main'> 
        <NavBar /></div>
        <Routes>
            <Route path='/' element={<Aries/>} />
            <Route path='taurus' element={<div className='newpage'> </div>} />
            <Route path='gemini' element={<div className='newpage'>gemini </div>} />
            <Route path='cancer' element={<div className='newpage'>cancer </div>} />
            <Route path='leo' element={<div className='newpage'>leo </div>} />
            <Route path='virgo' element={<div className='newpage'>virgo </div>} />
            <Route path='libra' element={<div className='newpage'>libra </div>} />
            <Route path='scorpio' element={<div className='newpage'>scorpio </div>} />
            <Route path='sagittarius' element={<div className='newpage'>sagittarius </div>} />
            <Route path='capricon' element={<div className='newpage'>capricon </div>} />
            <Route path='aquarius' element={<div className='newpage'>aquarius </div>} />
            <Route path='pisces' element={<div className='newpage'>pisces </div>} />
         

           
        </Routes>
        
        
        </BrowserRouter>
        


 
    );
    

}



export default App;
